window.bookSummaryJSON = "<p><b>An alien ship. Stolen colonists. All Throttle wanted was a vacation....</b></p> <p>Fifteen years into a 20-year voyage, war veteran Captain Throttle Reyne is looking forward to taking a break from dealing with malfunctions, glitches, and the hassles of monitoring 1,000 colonists in cryo-sleep.&nbsp;&nbsp;</p> <p>But when her colony ship breaks down in the middle of nowhere, Throttle and her crew must leave the colonists behind to search for help. They&nbsp;find a ship that's&nbsp;not only missing a crew...it's clearly not from their star system.&nbsp;&nbsp;</p> <p>It's the discovery&nbsp;of a lifetime. All they need to do is tow&nbsp;the mysterious vessel back to their colony ship for further study and Throttle won't ever have to work again. One problem. While they're away, the colony ship is stolen - with the colonists still on board.&nbsp;&nbsp;</p> <p>Throttle gives chase to a lawless star system on the outer rim. To get their colonists back, they must take on the pirates and ganglords who will do anything - and sell anyone - to make a buck.&nbsp;&nbsp;</p> <p>They play dirty. But Throttle and her crew play dirtier.&nbsp;</p> <p><b>Strap on your restraints and experience the start of this new space-opera thrill ride. It's perfect for fans of Jay Allan, Jennifer Foehner Wells, and Star Wars.</b></p>"; 
